	function loadMapComplete($self, paper, areas, plots, options) {
		$('.map-controls').show().css('opacity', 1);
		$('.preload-container').fadeOut();
		$('.map-container').show();
	}

	function updateMap() {
		var newMapOptions = jQuery.extend(true, {}, mapOptions);
		newMapOptions.areas = data[sliderValue]['areas'];
		$(".world").trigger('update', [{
			replaceOptions: true,
			mapOptions: newMapOptions
		}]);
	}

	//Storing flag for initial animation of element.
	var readoutFlag = 0;

	function nice_money(num) {
		if (num < 0.01 && num != 0) {
			return "Less than $0.01";
		} else {
			var formatter = new Intl.NumberFormat('en-US', {
				style: 'currency',
				currency: 'USD',
				minimumFractionDigits: 2,
			});
			return formatter.format(num);
		}
	}

	function nice_number(num) {
		var formatter = new Intl.NumberFormat('en-US', {
			style: 'decimal',
			minimumFractionDigits: 0,
		});
		return formatter.format(num);
	}

